import React from 'react';
import '../styles/Home.css';

function Home() {
  return (
    <div className="home">
      <header className="hero">
        <h1>Your Name or Website Title</h1>
        <p>A brief tagline or description</p>
      </header>

      <section className="about">
        <h2>About Me</h2>
        <p>A short description about yourself or your services</p>
      </section>

      <section className="featured-work">
        <h2>Featured Work</h2>
        {/* Add your featured projects here */}
      </section>

      <section className="skills">
        <h2>Skills</h2>
        {/* List your key skills here */}
      </section>

      <section className="contact">
        <h2>Contact</h2>
        {/* Add your contact information or a contact form */}
      </section>
    </div>
  );
}

export default Home;
